import { NavLink } from "react-router-dom";
import "./navbar.css";

const Navbar = () => {
  return (
    <>
      <nav className="navContainer">
        <NavLink to="/" className="navLogo">
          Navigation Bar
        </NavLink>
        <ul>
          <li className="navItem">test</li>
        </ul>
      </nav>
    </>
  );
};

export default Navbar;
